import React from 'react';
import '../App.css';
import HoverText from './src/HoverText';

const Home = () => {
	return (
		<div className="blog-page">
			<p>Blogsida</p>
				<a className="link" href="#">
					<div className="blog-link">
						<HoverText><div className="left-column">
							<span className="blog-date">datum</span>
							<span className="blog-cat">kategori</span>
						</div></HoverText>
							<h4 className="blog-text">text</h4>
					</div>
				</a>		
				<a className="link" href="#">
					<div className="blog-link">
						<div className="left-column">
							<span className="blog-date">datum</span>
							<span className="blog-cat">kategori</span>
						</div>	
							<h4 className="blog-text1">text</h4>
					</div>
				</a>		
		</div>
	);
};

export default Home;
